import { Link } from "react-router-dom";
import './memberCard.css'
import React from "react";

const MemberCard = ({ stories }) => {

  return (
    <div>
        <span className="member-name">Kaye Love</span>
        <img className="profile-img" src={require('./images/User.png')} alt=""/>
        <p className="desc">Member Since 2020</p>
        <p className="desc">Social @kayelove</p>
        <button className="actionButton">Read More</button>
    </div>
  );
};

export default MemberCard;
